import DefaultLayout from '../components/DefaultLayout';

export default function Browse() {
    return (
        <DefaultLayout>
            <BrowseView>
            </BrowseView>
        </DefaultLayout>
    );
}

const BrowseView = () => {
    return (
        <div>
            <img src={require("./img/data_viz.png")} alt="image"></img>
        </div>
    );
}
